// App.js
import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import StudentLogin from './components/StudentLogin';

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/student" component={StudentLogin} />
      </Switch>
    </Router>
  );
}

export default App;
